@MrRace, GPU quantization requires activation to be quantized symmetrically. did you follow the gpu quantization example when quanting for GPU: https://github.com/microsoft/onnxruntime-inference-examples/tree/main/quantization/image_classification/trt/resnet50? 

@jinfagang , please refer to here for expectation of performance gain of quantization: https://onnxruntime.ai/docs/performance/quantization.html#why-am-i-not-seeing-performance-improvements. 
And did you see warning like this when quantizing: https://github.com/microsoft/onnxruntime/blob/288892335e7499c4b235aea96fc097e3775435a1/onnxruntime/python/tools/quantization/quantize.py#L40
